import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

const UserList = () => {
  let [alldata, updateAlldata] = useState([]);
  const getuserinfo = () => {
    fetch("http://localhost:1250/details")
      .then((response) => response.json())
      .then((info) => {
        updateAlldata(info);
      });
  };
  useEffect(() => {
    getuserinfo();
    console.log(alldata);
  }, [1]);
  return (
    <div className="container mt-5">
      <div className="row">
        <div className="col-lg-3 border">
          <h4>Available Profile</h4>
          <div>
            {alldata.map((data, index) => {
              return (
                <div key={index}>
                  <li className=" list-group text-primary">{data.firstname}</li>
                </div>
              );
            })}
          </div>
        </div>
        <div className="col-lg-9 form bg-white shadow-lg rounded">
          <div className="form bg-white shadow-lg rounded">
            <table>
              <thead>
                {alldata.map((data, index) => {
                  return <tr key={index}></tr>;
                })}
              </thead>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserList;
